import React from "react";

class Time extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
         date : new Date()

        }
    }
    render() {
        const {date} = this.state;

        return (
        <div>{date.toLocaleTimeString()}</div>
        )
    }
}

export default Time;
